import React from "react";

function Toggle() {
  return (
    <div class="toggle">
      <input type="checkbox" name=""></input>
      <span
        class="vc-switch-label"
        data-on="Register Now"
        data-off="Register Now"
      ></span>
    </div>
  );
}

export default Toggle;
